var App;

App = window.App;

App.Collection = Backbone.Collection.extend({
  model: App.Model,
  localStorage: new Backbone.LocalStorage("Projects"),
  callbacks: {
    success: function(models) {
      return console.log("Collection Fetched.");
    },
    error: function(models) {
      return console.log("Collection fetch error.");
    }
  }
});

App.projects = new App.Collection();

App.projects.sync("read", App.projects, App.projects.callbacks);

